script: |
  super -f tsv -I q600.sql | sort > q600.out

vector: true

inputs:
  - name: q600.sql
    data: |
      SELECT - - cor1.col1 + ( - cor1.col2 ) * cor1.col1 / - cor1.col1 FROM tab0 AS cor0 CROSS JOIN tab2 AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q600.out
    data: |
      55
      55
      55
      58
      58
      58
      85
      85
      85
